import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import { Avatar, IconButton, Paper } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import Header from "../components/header/Header";

const paperStyle = {
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "#111113",
    backgroundImage: "none",
};

export default function Vitrin() {
    return (
        <Grid2 container flexDirection="column" sx={{ px: 2 }}>
            <Header />
            <Paper sx={paperStyle}>
                <Grid2
                    container
                    flexDirection="column"
                    justifyContent="space-between"
                    p={4}
                >
                    <Grid2>
                        <Typography color="warning.light">Trending</Typography>
                        <Typography variant="h5">JOKER</Typography>
                    </Grid2>
                    <Typography>24 Stories</Typography>
                </Grid2>
                <img src="/images/joker.jpg" alt="joker" width={200} />
            </Paper>
        </Grid2>
    );
}
